import React from 'react'
import Moment from 'moment'

class DateItem extends React.Component {

  render(){
    console.log(this.props.date.date);
    return(
      <div>
      <p>{moment(this.props.date.date).format('DD MMM, YYYY')}</p>
      </div>
    )
  }
}

export default DateItem
